INSERT INTO `%DB_PREFIX%agreement` (`id`, `agreement`, `agreement_name`, `agreement_cate`, `sort`, `is_effect`, `create_time`) VALUES
(7, '<h4 style="margin:0px 0px 10px;padding:0px;font-size:20px;font-family:''microsoft yahei'', verdana;line-height:26px;text-align:center;">谷创商城夺宝平台支持者协议</h4>\n<div style="font-family:''microsoft yahei'', verdana;font-size:14px;line-height:26px;text-indent:2em;word-wrap:break-word;word-break:break-all;"><p style="margin-top:0px;margin-bottom:0px;padding:0px;">欢迎访问谷创商城夺宝平台，为明确您（以下简称为“支持者”）的权利义务，保护支持者的合法权益，特制定本协议。申请使用福建睿辰科技有限公司提供的谷创商城夺宝平台（以下简称为平台“）服务（包括谷创商城夺宝和一口价服务），请支持者仔细阅读以下全部内容<b style="text-decoration:underline;"><span style="color:#d40a00;">（特别是粗体下划线标注的内容）</span></b>。如支持者不同意本服务条款任意内容，请勿注册或使用平台服务。如支持者通过进入注册程序并勾选“我同意平台服务协议”，即表示支持者与福建睿辰科技有限公司已达成协议，自愿接受本服务条款的所有内容。此后，支持者不得以未阅读本服务条款内容作任何形式的抗辩。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">鉴于：平台以“众筹”模式为各类商品的销售提供网络空间。在本平台，商品被平分成若干等分，支持者可以使用通宝支持一份或多份，当等份全部售完后，由系统根据平台规则计算出最终获得商品或服务的支持者，其他支持者则可获得相应的“宝石”。</p>\n<p style="margin-top:20px;margin-bottom:0px;padding:0px;"><b>一、支持者使用平台服务的前提条件</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">1、支持者拥有福建睿辰科技有限公司认可的帐号。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">2、支持者在使用平台服务时须具备相应的权利能力和行为能力，能够独立承担法律责任，如果支持者在18周岁以下，必须在父母或监护人的监护参与下才能使用本站。</p>\n<p style="margin-top:20px;margin-bottom:0px;padding:0px;"><b>二、支持者管理</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">1、支持者ID</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">支持者首次登录平台时，平台会为每位支持者生成一个帐户ID，作为其使用平台服务的唯一身份标识，支持者需要对其帐户项下发生的所有行为负责。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">2、支持者资料完善</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">支持者应当在使用平台服务时完善个人资料，支持者资料包括但不限于个人手机号码、收货地址、帐号昵称、头像、密码得。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">支持者在完善个人资料时承诺遵守法律法规、社会主义制度、国家利益、公民合法权益、公共秩序、社会道德风尚和信息真实性等七条底线，不得在资料中出现违法和不良信息，且支持者保证其在完善个人资料和使用帐号时，不得有以下情形：</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（1）违反宪法或法律法规规定的；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（2）危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（3）损害国家荣誉和利益的，损害公共利益的；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（4）煽动民族仇恨、民族歧视，破坏民族团结的；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（5）破坏国家宗教政策，宣扬邪教和封建迷信的；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（6）散布谣言，扰乱社会秩序，破坏社会稳定的</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（7）散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（8）侮辱或者诽谤他人，侵害他人合法权益的；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（9）含有法律、行政法规禁止的其他内容的。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">若支持者提供给福建睿辰科技有限公司的资料不准确，不真实，含有违法或不良信息的，福建睿辰科技有限公司有权不予完善，并保留终止支持者使用平台服务的权利。若支持者以虚假信息骗取帐号ID或帐号头像、个人简介等注册资料存在违法和不良信息的，福建睿辰科技有限公司有权采取通知限期改正、暂停使用、注销登记等措施。对于冒用关联机构或社会名人注册帐号名称的，福建睿辰科技有限公司有权注销该帐号，并向政府主管部门进行报告。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">根据相关法律、法规规定以及考虑到平台服务的重要性，支持者同意：</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（1）在完善资料时提交个人有效身份信息进行实名认证；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（2）提供及时、详尽及准确的支持者资料；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（3）不断更新支持者资料，符合及时、详尽准确的要求，对完善个人资料时填写的身份证件信息不能更新。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（4）<b style="text-decoration:underline;">支持者有证明该帐号为本人所有的义务，需能提供注册资料或第三方平台注册资料以证明该帐号为本人所有，否则网易公司有权暂缓向支持者交付其所获得的商品。</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">3、通宝及宝石</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（1）<b style="text-decoration:underline;">支持者获得通宝并使用后可根据宝石获得规则获取相应的宝石。通宝的有效期自获得之日起算360天，有效期不可中断或延期，有效期届满后，支持者帐户中有效期届满的通宝将被清空，且不可恢复。宝石自获得之日起生效，使用期限将在宝石规则中规定，详见平台页面提示。</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（2）通宝必须通过福建睿辰科技有限公司提供或认可的平台获得，从非福建睿辰科技有限公司提供或认可的平台所获得的通宝将被认定为来源不符合本服务协议，福建睿辰科技有限公司有权拒绝从非我公司提供或认可的平台所获得的通宝在平台中使用。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（3）<b style="text-decoration:underline;">通宝及宝石不能在平台之外使用或者转移给其他支持者。</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">4、支持者应当保证在使用平台服务的过程中遵守诚实信用原则，不扰乱平台的正常秩序，<b style="text-decoration:underline;">不得通过使用他人帐户、一人注册多个帐户、使用程序自动处理等非法方式损害他人或</b><span style="text-indent:2em;"><b><u>福建睿辰科技有限公司</u></b></span><b style="text-indent:2em;text-decoration:underline;">的利益。</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">5、若支持者存在任何违法或违反本服务协议约定的行为，福建睿辰科技有限公司有权视支持者的违法或违规情况适用以下一项或多项处罚措施：</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">（1）责令支持者改正违法或违规行为；</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">（2）中止、终止部分或全部服务；</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">（3）取消支持者夺宝订单并取消商品发放（若支持者已获得商品）， 且支持者已获得的通宝不予退回；</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">（4）冻结或注销支持者帐号及其帐号中的通宝及宝石（如有）；</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">（5）其他</b><b><u>福建睿辰科技有限公司</u></b><b style="text-decoration:underline;">认为合适在符合法律法规规定的情况下的处罚措施。</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">若支持者的行为造成</b><b><u>福建睿辰科技有限公司</u></b><b style="text-decoration:underline;">及其关联公司损失的，支持者还应承担赔偿责任。</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">6、若支持者发表侵犯他人权利或违反法律规定的言论，</b><u><b>福建睿辰科技有限公司</b></u><b style="text-decoration:underline;">有权停止传输并删除其言论、禁止该支持者发言、注销支持者帐号及其帐号中的通宝（如有），同时，</b><b><u>福建睿辰科技有限公司</u></b><b style="text-decoration:underline;">保留根据国家法律法规、相关政策向有关机关报告的权利。</b></p>\n<p style="margin-top:20px;margin-bottom:0px;padding:0px;"><b>三、谷创商城夺宝</b><b style="text-indent:2em;">众筹平台服务的规则</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">1、释义</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（1）通宝：指支持者在平台上购买商品的资金的呈现方式。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（2）夺宝号码：指支持者使用通宝参与一元夺宝服务时所获取的随机分配号码。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（3）幸运号码：指与某件商品的全部夺宝号码分配完毕后，一元夺宝根据夺宝规则（详见一元夺宝官方页面）计算出的一个号码。持有该幸运号码的支持者可直接获得该商品。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（4）宝石：指支持者参与平台活动后，其获得的夺宝号码中未包含幸运号码的情况下，可获取的相应回报。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（5）全价购买：指支持者以固定价格直接获得平台商品的形式。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（6）一元夺宝：指支持者通过平台获得通宝，然后凭通宝参与平台活动，并在使用通宝后根据宝石获得规则获取相应宝石的形式。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">2、福建睿辰科技有限公司承诺遵循公平、公正、公开的原则运营平台，确保所有支持者在平台中享受同等的权利与义务，夺宝结果向所有支持者公示。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">3、支持者知悉，除本协议另有约定外，无论是否获得商品，支持者已用于参与平台活动的通宝不能退回；其完全了解参与平台活动存在的风险，福建睿辰科技有限公司不保证支持者参与一元夺宝一定会获得商品，但支持者参与后可根据宝石规则获得相应的宝石。宝石规则，详见“我的夺宝”下的“我的宝石”栏目。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">4、支持者通过参与平台活动获得商品后，应在7天内登录平台提交或确认收货地址，否则视为放弃该商品，支持者因此行为造成的损失，</b><u><b>福建睿辰科技有限公司</b></u><b style="text-decoration:underline;">不承担任何责任。</b>商品由福建睿辰科技有限公司或经福建睿辰科技有限公司确认的第三方商家提供及发货。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">5、支持者通过参与平台活动获得的商品，享受该商品生产厂家提供的三包服务，具体三包规定以该商品生产厂家公布的为准。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">6、如果下列情形发生，</b><b><u>福建睿辰科技有限公司</u></b><b style="text-decoration:underline;">有权取消支持者夺宝订单：</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">（1）因不可抗力、平台系统发生故障或遭受第三方攻击，或发生其他</b><b><u>福建睿辰科技有限公司</u></b><b style="text-decoration:underline;">无法控制的情形；</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">（2）根据</b><b><u>福建睿辰科技有限公司</u></b><b style="text-decoration:underline;">已经发布的或将来可能发布或更新的各类规则、公告的规定，</b><b><u>福建睿辰科技有限公司</u></b><b style="text-decoration:underline;">有权取消支持者订单的情形。</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><span style="text-indent:2em;"><b><u>福建睿辰科技有限公司</u></b></span><b style="text-decoration:underline;">有权取消支持者的订单时，支持者可申请退还通宝，所退通宝将在3个工作日内退还至支持者帐户中。</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">7、若某件商品的夺宝号码从开始分配之日起90天未分配完毕，则福建睿辰科技有限公司有权取消该件商品的夺宝活动，并向支持者退还通宝，所退还通宝将在3个工作日内退还至支持者帐户中。</p>\n<p style="margin-top:20px;margin-bottom:0px;padding:0px;"><b>四、本服务协议的修改</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">支持者知晓福建睿辰科技有限公司不时公布或修改的与本服务协议有关的其他规则、条款及公告等是本服务协议的组成部分。福建睿辰科技有限公司有权在必要时通过在平台内发出公告等合理方式修改本服务协议，支持者在享受各项服务时，应当及时查阅了解修改的内容，并自觉遵守本服务协议。支持者如继续使用本服务协议涉及的服务，则视为对修改内容的同意，当发生有关争议时，以最新的服务协议为准；支持者在不同意修改内容的情况下，有权停止使用本服务协议涉及的服务。</p>\n<p style="margin-top:0px;margin-bottom:30px;padding:0px;">如支持者对本规则内容有任何疑问，可拨打客服电话0598-6605280。</p>\n</div>\n', '服务协议', 'agreement', 0, 1, 1468885332),
(8, '一元夺宝幸运号码计算公式，加入了“老时时彩”数据作为公正数据源，保证开奖结果的随机性，保证绝对公正性。', '公告', 'notice', 0, 1, 1468886949);
