(377, 180, '联通20元充值卡 秒杀场', 48, '<div style="margin:0px;padding:0px;color:#333333;font-family:''microsoft yahei'', verdana;"><p style="text-align:right;margin:0px;padding:0px;font-size:12px;"><span style="color:#000000;font-size:16px;"><img src="./public/attachment/201607/19/23/578e41aa369cf.jpg" alt="" border="0" /><br />\n</span></p>\n<p style="margin:0px;padding:0px;font-size:12px;"><span style="color:#000000;font-size:16px;"><br />\n</span></p>\n<p style="margin:0px;padding:0px;font-size:12px;"><span style="color:#000000;font-size:16px;">使用方法一：</span></p>\n<p><span style="color:#000000;font-size:16px;">得到卡密后请拨打10010根据语音提示选择充值卡充值。如果本机欠费，请选择其它联通（必须和你欠费的手机归属地一致）手机充值。</span></p>\n</div>\n<div><h2><span style="font-size:16px;">使用方法二：</span></h2>\n<p><span style="font-size:16px;">您可以使用充值卡，充值到支付宝。</span><br />\n<span style="font-size:16px;">首先，您要拥有支付宝账号，打开支付宝客户端，使用您的支付宝账号登录。进入“我的”页面，选择“余额”，点击“充值”，选择“使用话费卡充值”即可。（方法见下图）</span><br />\n<span style="font-size:16px;">支付宝充值注意事项：</span><br />\n<span style="font-size:16px;">1.支付宝仅支持移动、联通、电信的30元、50元、100元的话费卡充值。</span><br />\n<span style="font-size:16px;">2.当选择的面值与实际面值不一致时，您将损失差额，而且会造成延迟到账，请正确选择。</span><br />\n<span style="font-size:16px;">3.转让成功前请不要丢弃实体卡。</span><br />\n<span style="font-size:16px;">4.需通过实名认证才可使用。</span><br />\n<span style="font-size:16px;">5.每日最高限额5000元。</span><br />\n<span style="font-size:16px;">6.暂不支持100元以上的充值卡。</span></p>\n<p><br />\n</p>\n<p style="text-align:center;"><img src="./public/attachment/201607/19/23/578e414f908e6.jpg" alt="" border="0" /><br />\n</p>\n<p style="text-align:center;"><img src="./public/attachment/201607/19/23/578e4164cdbdf.jpg" alt="" border="0" /><br />\n</p>\n<p style="text-align:center;"><img src="./public/attachment/201607/19/23/578e416e1e5f4.jpg" alt="" border="0" /><br />\n</p>\n<p><br />\n</p>\n<p><br />\n</p>\n<div><p><span style="font-size:16px;">温馨提示：收到卡密信息后请不要透露给第三方，请尽快充值或留作他用。如有其他疑问，请咨询客服。</span></p>\n</div>\n<dl><dt><span style="font-size:16px;">重要说明：</span></dt><dd><spa