(1, '关于谷创商城夺宝', '<div class="m-helpcenter-detail-hd" style="padding:7px 0px 10px;border-bottom-width:2px;border-bottom-style:solid;border-bottom-color:#dddddd;line-height:24px;font-size:24px;color:#808080;font-family:;" microsoft="" yahei",="" verdana;"=""><h4 style="margin:0px;padding:0px 0px 0px 12px;font-weight:normal;border-left-width:6px;border-left-style:solid;border-left-color:#db3652;color:#db3652;font-family:;" microsoft="" yahei";"="">了解谷创商城夺宝平台</h4>\n</div>\n<div class="m-helpcenter-detail-bd" pro="wrap" style="padding-top:20px;font-size:14px;line-height:26px;color:#808080;font-family:;" microsoft="" yahei",="" verdana;"=""><div class="m-helpcenter-main" style="font-family:;" microsoft="" yahei",="" simhei;line-height:24px;overflow:hidden;background:url("img="" 94c32e28f2fc9b5d7881e9e201177c97fd6ede31.jpg")="" left="" bottom="" no-repeat;"=""><h3 style="margin:24px 0px 15px;padding:0px;font-size:26px;font-weight:normal;width:136px;height:37px;line-height:37px;color:#ffffff;text-align:center;background:#db3652;">谷创商城夺宝</h3>\n<div class="m-helpcenter-main-txt"><p class="m-helpcenter-main-intro" style="margin-top:0px;margin-bottom:30px;padding:0px;font-size:16px;text-indent:2em;"><img src="./public/attachment/201607/20/10/578ee87262a15.jpg" width="454" height="279" align="right" alt="" border="0" />“谷创商城夺宝平台”以“众筹”模式为各类商品的销售提供的网络空间。在本平台，商品被平分成若干等份，支持者可以使用通宝支持一份或多份，当等份全部售完后，由系统根据平台规则计算出最终获得商品的支持者，其他支持者则可获得相应的“宝石”。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;text-indent:2em;">商品由入驻谷创商城夺宝平台的商家发起方提供。</p>\n</div>\n</div>\n<div class="m-helpcenter-main" style="font-family:;" microsoft="" yahei",="" simhei;line-height:24px;overflow:hidden;background:url("img="" 94c32e28f2fc9b5d7881e9e201177c97fd6ede31.jpg")="" left="" bottom="" no-repeat;"=""><h3 style="margin:24px 0px 15px;padding:0px;font-size:26px;font-weight:normal;width:136px;height:37px;line-height:37px;color:#ffffff;text-align:center;background:#db3652;">3步操作</h3>\n<img src="./public/attachment/201607/20/10/578ee88b859ff.jpg" alt="" border="0" /><br />\n<ul class="m-helpcenter-stepList" style="margin:0px 0px 126px;padding:15px 0px 0px 30px;list-style:none;"><li class="m-helpcenter-stepList-item" style="margin:0px 115px 0px 0px;padding:0px;display:inline;float:left;font-size:17px;width:200px;text-align:center;"><p style="margin-top:0px;margin-bottom:0px;padding:0px;">获得通宝</p>\n</li>\n<li class="m-helpcenter-stepList-item" style="margin:0px 115px 0px 0px;padding:0px;display:inline;float:left;font-size:17px;width:200px;text-align:center;"><p style="margin-top:0px;margin-bottom:0px;padding:0px;">选择喜欢的商品</p>\n</li>\n<li class="m-helpcenter-stepList-item last" style="margin:0px;padding:0px;display:inline;float:left;font-size:17px;width:200px;text-align:center;"><p style="margin-top:0px;margin-bottom:0px;padding:0px;">等待揭晓</p>\n</li>\n</ul>\n</div>\n<div class="m-helpcenter-ext" style="font-family:;" microsoft="" yahei",="" simhei;line-height:24px;overflow:hidden;"=""><h4 style="margin:0px 0px 10px 5px;padding:0px 0px 0px 15px;font-size:22px;border-left-width:6px;border-left-style:solid;border-left-color:#db3652;color:#db3652;line-height:26px;">谷创商城夺宝规则</h4>\n<ol style="margin:0px 0px 50px;padding:25px 0px 0px 25px;list-style:none;"><li style="margin:0px 0px 5px;padding:0px;"><span class="index" style="margin-right:10px;display:inline-block;width:20px;height:20px;text-align:center;line-height:20px;border-radius:50%;color:#ffffff;background-color:#ed9aa8;">1</span><b>获得通宝：</b>支持者根据平台规则操作可获得对应通宝；</li>\n<li style="margin:0px 0px 5px;padding:0px;"><span class="index" style="margin-right:10px;display:inline-block;width:20px;height:20px;text-align:center;line-height:20px;border-radius:50%;color:#ffffff;background-color:#ed9aa8;">2</span><b>挑选喜欢的商品：</b>商品分配对应数量的号码，使用对应通宝，可以获得其中1个号码（系统随机分配）；</li>\n<li style="margin:0px 0px 5px;padding:0px;"><span class="index" style="margin-right:10px;display:inline-block;width:20px;height:20px;text-align:center;line-height:20px;border-radius:50%;color:#ffffff;background-color:#ed9aa8;">3</span><b>获得商品：</b>当所有号码都被分配完毕后，系统根据规则计算出1个幸运号码，持有该号码的支持者，直接获得该商品。</li>\n</ol>\n<h4 style="margin:0px 0px 10px 5px;padding:0px 0px 0px 15px;font-size:22px;border-left-width:6px;border-left-style:solid;border-left-color:#db3652;color:#db3652;line-height:26px;">幸运号码计算规则</h4>\n<ol style="margin:0px 0px 50px;padding:25px 0px 0px 25px;list-style:none;"><li style="margin:0px 0px 5px;padding:0px;"><span class="index" style="margin-right:10px;display:inline-block;width:20px;height:20px;text-align:center;line-height:20px;border-radius:50%;color:#ffffff;background-color:#ed9aa8;">1</span>商品的最后一个号码分配完毕后，将公示截止该时间点本站全部商品的最后50个参与时间；</li>\n<li style="margin:0px 0px 5px;padding:0px;"><span class="index" style="margin-right:10px;display:inline-block;width:20px;height:20px;text-align:center;line-height:20px;border-radius:50%;color:#ffffff;background-color:#ed9aa8;">2</span>将这50个时间的数值进行求和（得出数值A）（每个时间按时、分、秒、毫秒的顺序组合，如20:15:25.362则为201525362）；</li>\n<li style="margin:0px 0px 5px;padding:0px;"><span class="index" style="margin-right:10px;display:inline-block;width:20px;height:20px;text-align:center;line-height:20px;border-radius:50%;color:#ffffff;background-color:#ed9aa8;">3</span>为保证公平公正公开，系统还会等待一小段时间，取最近下一期中国福利彩票“老时时彩”的揭晓结果（一个五位数值B）；</li>\n<li style="margin:0px 0px 5px;padding:0px;"><span class="index" style="margin-right:10px;display:inline-block;width:20px;height:20px;text-align:center;line-height:20px;border-radius:50%;color:#ffffff;background-color:#ed9aa8;">4</span>（数值A+数值B）除以该商品总需人次得到的余数&nbsp;+ 原始数&nbsp;10000001，得到最终幸运号码，拥有该幸运号码者，直接获得该商品。</li>\n<li class="esp" style="margin:25px 0px 5px;padding:0px;">注：如遇福彩中心通讯故障，无法获取上述期数的中国福利彩票“老时时彩”揭晓结果，且24小时内该期“老时时彩”揭晓结果仍未公布，则默认“老时时彩”揭晓结果为00000。</li>\n</ol>\n<h4 style="margin:0px 0px 10px 5px;padding:0px 0px 0px 15px;font-size:22px;border-left-width:6px;border-left-style:solid;border-left-color:#db3652;color:#db3652;line-height:26px;">关于“老时时彩”</h4>\n<ol style="margin:0px 0px 50px;padding:25px 0px 0px 25px;list-style:none;"><li style="margin:0px 0px 5px;padding:0px;"><span class="index" style="margin-right:10px;display:inline-block;width:20px;height:20px;text-align:center;line-height:20px;border-radius:50%;color:#ffffff;background-color:#ed9aa8;">1</span>“老时时彩”是由中国福彩中心发行的一种彩票，谷创商城夺宝仅取其结果作为抗干扰数据源，以示公平公正公开，和“老时时彩”本身没有任何关系；</li>\n<li style="margin:0px 0px 5px;padding:0px;"><span class="index" style="margin-right:10px;display:inline-block;width:20px;height:20px;text-align:center;line-height:20px;border-radius:50%;color:#ffffff;background-color:#ed9aa8;">2</span>“老时时彩”每天10:00-22:00-02:00进行揭晓，白天72期，10分钟揭晓，夜间48期，5分钟揭晓，停开时间以福彩中心公布信息为准；</li>\n<li style="margin:0px 0px 5px;padding:0px;"><span class="index" style="margin-right:10px;display:inline-block;width:20px;height:20px;text-align:center;line-height:20px;border-radius:50%;color:#ffffff;background-color:#ed9aa8;">3</span>了解更多“老时时彩”信息，可自行至彩点查询。</li>\n</ol>\n<h4 style="margin:0px 0px 10px 5px;padding:0px 0px 0px 15px;font-size:22px;border-left-width:6px;border-left-style:solid;border-left-color:#db3652;color:#db3652;line-height:26px;">晒单规则</h4>\n<p style="margin-top:25px;margin-bottom:0px;padding:0px;text-indent:2em;">如果您获得商品了，可以通过晒单和网友们分享喜悦，帮助大家更充分的了解谷创商城夺宝平台的乐趣，而且，晒单成功，会获得直减红包奖励，最高价值10通宝！晒单的时候，我们提醒您注意以下几点：</p>\n<ol style="margin:0px 0px 5px;padding:5px 0px 0px 25px;list-style:none;"><li style="margin:0px 0px 5px;padding:0px;"><span class="index" style="margin-right:10px;display:inline-block;width:20px;height:20px;text-align:center;line-height:20px;border-radius:50%;color:#ffffff;background-color:#ed9aa8;">1</span>详细的内容，是晒单的精华，因此，建议您的晒单不少于50字，并且配上3张以上不同的照片（跪求高清无码）；</li>\n<li style="margin:0px 0px 5px;padding:0px;"><span class="index" style="margin-right:10px;display:inline-block;width:20px;height:20px;text-align:center;line-height:20px;border-radius:50%;color:#ffffff;background-color:#ed9aa8;">2</span>真实，是晒单的灵魂，因此，您可以将快递单号也晒上来哦~（快递单上的个人隐私部分，建议您马赛克处理下&amp;*%^%$%^$）</li>\n<li style="margin:0px 0px 5px;padding:0px;"><span class="index" style="margin-right:10px;display:inline-block;width:20px;height:20px;text-align:center;line-height:20px;border-radius:50%;color:#ffffff;background-color:#ed9aa8;">3</span>一般大家都喜欢沾仙气，因此，您能够出镜和商品合个影儿什么的，给大家一起膜拜就再好不过了！</li>\n<li style="margin:0px 0px 5px;padding:0px;"><span class="index" style="margin-right:10px;display:inline-block;width:20px;height:20px;text-align:center;line-height:20px;border-radius:50%;color:#ffffff;background-color:#ed9aa8;">4</span>晒单的质量越高越好玩，红包的价值就越高哦！</li>\n<li style="margin:0px 0px 5px;padding:0px;"><span class="index" style="margin-right:10px;display:inline-block;width:20px;height:20px;text-align:center;line-height:20px;border-radius:50%;color:#ffffff;background-color:#ed9aa8;">5</span>如果同一类商品多次获得，请勿简单的复制粘贴之前的晒单内容。</li>\n</ol>\n</div>\n</div>\n', 1, 1468887833, 1468954726, 0, 1, '', 0, 0, 0, 1, '', '', '', '', 0, '', ''),
(2, '服务协议', '<h4 style="margin:0px 0px 10px;padding:0px;font-size:20px;font-family:''microsoft yahei'', verdana;line-height:26px;text-align:center;">谷创商城夺宝平台支持者协议</h4>\n<div style="font-family:''microsoft yahei'', verdana;font-size:14px;line-height:26px;text-indent:2em;word-wrap:break-word;word-break:break-all;"><p style="margin-top:0px;margin-bottom:0px;padding:0px;">欢迎访问谷创商城夺宝平台，为明确您（以下简称为“支持者”）的权利义务，保护支持者的合法权益，特制定本协议。申请使用福建睿辰科技有限公司提供的谷创商城夺宝平台（以下简称为平台“）服务（包括谷创商城夺宝和一口价服务），请支持者仔细阅读以下全部内容<b style="text-decoration:underline;"><span style="color:#d40a00;">（特别是粗体下划线标注的内容）</span></b>。如支持者不同意本服务条款任意内容，请勿注册或使用平台服务。如支持者通过进入注册程序并勾选“我同意平台服务协议”，即表示支持者与福建睿辰科技有限公司已达成协议，自愿接受本服务条款的所有内容。此后，支持者不得以未阅读本服务条款内容作任何形式的抗辩。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">鉴于：平台以“众筹”模式为各类商品的销售提供网络空间。在本平台，商品被平分成若干等分，支持者可以使用通宝支持一份或多份，当等份全部售完后，由系统根据平台规则计算出最终获得商品或服务的支持者，其他支持者则可获得相应的“宝石”。</p>\n<p style="margin-top:20px;margin-bottom:0px;padding:0px;"><b>一、支持者使用平台服务的前提条件</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">1、支持者拥有福建睿辰科技有限公司认可的帐号。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">2、支持者在使用平台服务时须具备相应的权利能力和行为能力，能够独立承担法律责任，如果支持者在18周岁以下，必须在父母或监护人的监护参与下才能使用本站。</p>\n<p style="margin-top:20px;margin-bottom:0px;padding:0px;"><b>二、支持者管理</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">1、支持者ID</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">支持者首次登录平台时，平台会为每位支持者生成一个帐户ID，作为其使用平台服务的唯一身份标识，支持者需要对其帐户项下发生的所有行为负责。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">2、支持者资料完善</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">支持者应当在使用平台服务时完善个人资料，支持者资料包括但不限于个人手机号码、收货地址、帐号昵称、头像、密码得。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">支持者在完善个人资料时承诺遵守法律法规、社会主义制度、国家利益、公民合法权益、公共秩序、社会道德风尚和信息真实性等七条底线，不得在资料中出现违法和不良信息，且支持者保证其在完善个人资料和使用帐号时，不得有以下情形：</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（1）违反宪法或法律法规规定的；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（2）危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（3）损害国家荣誉和利益的，损害公共利益的；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（4）煽动民族仇恨、民族歧视，破坏民族团结的；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（5）破坏国家宗教政策，宣扬邪教和封建迷信的；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（6）散布谣言，扰乱社会秩序，破坏社会稳定的</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（7）散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（8）侮辱或者诽谤他人，侵害他人合法权益的；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（9）含有法律、行政法规禁止的其他内容的。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">若支持者提供给福建睿辰科技有限公司的资料不准确，不真实，含有违法或不良信息的，福建睿辰科技有限公司有权不予完善，并保留终止支持者使用平台服务的权利。若支持者以虚假信息骗取帐号ID或帐号头像、个人简介等注册资料存在违法和不良信息的，福建睿辰科技有限公司有权采取通知限期改正、暂停使用、注销登记等措施。对于冒用关联机构或社会名人注册帐号名称的，福建睿辰科技有限公司有权注销该帐号，并向政府主管部门进行报告。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">根据相关法律、法规规定以及考虑到平台服务的重要性，支持者同意：</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（1）在完善资料时提交个人有效身份信息进行实名认证；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（2）提供及时、详尽及准确的支持者资料；</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（3）不断更新支持者资料，符合及时、详尽准确的要求，对完善个人资料时填写的身份证件信息不能更新。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（4）<b style="text-decoration:underline;">支持者有证明该帐号为本人所有的义务，需能提供注册资料或第三方平台注册资料以证明该帐号为本人所有，否则网易公司有权暂缓向支持者交付其所获得的商品。</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">3、通宝及宝石</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（1）<b style="text-decoration:underline;">支持者获得通宝并使用后可根据宝石获得规则获取相应的宝石。通宝的有效期自获得之日起算360天，有效期不可中断或延期，有效期届满后，支持者帐户中有效期届满的通宝将被清空，且不可恢复。宝石自获得之日起生效，使用期限将在宝石规则中规定，详见平台页面提示。</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（2）通宝必须通过福建睿辰科技有限公司提供或认可的平台获得，从非福建睿辰科技有限公司提供或认可的平台所获得的通宝将被认定为来源不符合本服务协议，福建睿辰科技有限公司有权拒绝从非我公司提供或认可的平台所获得的通宝在平台中使用。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（3）<b style="text-decoration:underline;">通宝及宝石不能在平台之外使用或者转移给其他支持者。</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">4、支持者应当保证在使用平台服务的过程中遵守诚实信用原则，不扰乱平台的正常秩序，<b style="text-decoration:underline;">不得通过使用他人帐户、一人注册多个帐户、使用程序自动处理等非法方式损害他人或</b><span style="text-indent:2em;"><b><u>福建睿辰科技有限公司</u></b></span><b style="text-indent:2em;text-decoration:underline;">的利益。</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">5、若支持者存在任何违法或违反本服务协议约定的行为，福建睿辰科技有限公司有权视支持者的违法或违规情况适用以下一项或多项处罚措施：</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">（1）责令支持者改正违法或违规行为；</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">（2）中止、终止部分或全部服务；</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">（3）取消支持者夺宝订单并取消商品发放（若支持者已获得商品）， 且支持者已获得的通宝不予退回；</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">（4）冻结或注销支持者帐号及其帐号中的通宝及宝石（如有）；</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">（5）其他</b><b><u>福建睿辰科技有限公司</u></b><b style="text-decoration:underline;">认为合适在符合法律法规规定的情况下的处罚措施。</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">若支持者的行为造成</b><b><u>福建睿辰科技有限公司</u></b><b style="text-decoration:underline;">及其关联公司损失的，支持者还应承担赔偿责任。</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">6、若支持者发表侵犯他人权利或违反法律规定的言论，</b><u><b>福建睿辰科技有限公司</b></u><b style="text-decoration:underline;">有权停止传输并删除其言论、禁止该支持者发言、注销支持者帐号及其帐号中的通宝（如有），同时，</b><b><u>福建睿辰科技有限公司</u></b><b style="text-decoration:underline;">保留根据国家法律法规、相关政策向有关机关报告的权利。</b></p>\n<p style="margin-top:20px;margin-bottom:0px;padding:0px;"><b>三、谷创商城夺宝</b><b style="text-indent:2em;">众筹平台服务的规则</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">1、释义</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（1）通宝：指支持者在平台上购买商品的资金的呈现方式。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（2）夺宝号码：指支持者使用通宝参与一元夺宝服务时所获取的随机分配号码。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（3）幸运号码：指与某件商品的全部夺宝号码分配完毕后，一元夺宝根据夺宝规则（详见一元夺宝官方页面）计算出的一个号码。持有该幸运号码的支持者可直接获得该商品。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（4）宝石：指支持者参与平台活动后，其获得的夺宝号码中未包含幸运号码的情况下，可获取的相应回报。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（5）全价购买：指支持者以固定价格直接获得平台商品的形式。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">（6）一元夺宝：指支持者通过平台获得通宝，然后凭通宝参与平台活动，并在使用通宝后根据宝石获得规则获取相应宝石的形式。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">2、福建睿辰科技有限公司承诺遵循公平、公正、公开的原则运营平台，确保所有支持者在平台中享受同等的权利与义务，夺宝结果向所有支持者公示。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">3、支持者知悉，除本协议另有约定外，无论是否获得商品，支持者已用于参与平台活动的通宝不能退回；其完全了解参与平台活动存在的风险，福建睿辰科技有限公司不保证支持者参与一元夺宝一定会获得商品，但支持者参与后可根据宝石规则获得相应的宝石。宝石规则，详见“我的夺宝”下的“我的宝石”栏目。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">4、支持者通过参与平台活动获得商品后，应在7天内登录平台提交或确认收货地址，否则视为放弃该商品，支持者因此行为造成的损失，</b><u><b>福建睿辰科技有限公司</b></u><b style="text-decoration:underline;">不承担任何责任。</b>商品由福建睿辰科技有限公司或经福建睿辰科技有限公司确认的第三方商家提供及发货。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">5、支持者通过参与平台活动获得的商品，享受该商品生产厂家提供的三包服务，具体三包规定以该商品生产厂家公布的为准。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">6、如果下列情形发生，</b><b><u>福建睿辰科技有限公司</u></b><b style="text-decoration:underline;">有权取消支持者夺宝订单：</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">（1）因不可抗力、平台系统发生故障或遭受第三方攻击，或发生其他</b><b><u>福建睿辰科技有限公司</u></b><b style="text-decoration:underline;">无法控制的情形；</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><b style="text-decoration:underline;">（2）根据</b><b><u>福建睿辰科技有限公司</u></b><b style="text-decoration:underline;">已经发布的或将来可能发布或更新的各类规则、公告的规定，</b><b><u>福建睿辰科技有限公司</u></b><b style="text-decoration:underline;">有权取消支持者订单的情形。</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;"><span style="text-indent:2em;"><b><u>福建睿辰科技有限公司</u></b></span><b style="text-decoration:underline;">有权取消支持者的订单时，支持者可申请退还通宝，所退通宝将在3个工作日内退还至支持者帐户中。</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">7、若某件商品的夺宝号码从开始分配之日起90天未分配完毕，则福建睿辰科技有限公司有权取消该件商品的夺宝活动，并向支持者退还通宝，所退还通宝将在3个工作日内退还至支持者帐户中。</p>\n<p style="margin-top:20px;margin-bottom:0px;padding:0px;"><b>四、本服务协议的修改</b></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;">支持者知晓福建睿辰科技有限公司不时公布或修改的与本服务协议有关的其他规则、条款及公告等是本服务协议的组成部分。福建睿辰科技有限公司有权在必要时通过在平台内发出公告等合理方式修改本服务协议，支持者在享受各项服务时，应当及时查阅了解修改的内容，并自觉遵守本服务协议。支持者如继续使用本服务协议涉及的服务，则视为对修改内容的同意，当发生有关争议时，以最新的服务协议为准；支持者在不同意修改内容的情况下，有权停止使用本服务协议涉及的服务。</p>\n<p style="margin-top:0px;margin-bottom:30px;padding:0px;">如支持者对本规则内容有任何疑问，可拨打客服电话0598-6605280。</p>\n</div>\n', 1, 1468887857, 1468893146, 0, 1, '', 0, 0, 0, 2, '', '', '', '', 0, '', ''),
(3, '常见问题', '<p><br />\n</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;"><span style="line-height:1.5;">1、充值获得通宝，然后选择喜欢的商品开始夺宝；</span></p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;"><span style="line-height:1.5;"><br />\n</span></p>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;">2、点击一个感兴趣的商品，选择要参与的人次并支付，直接充值并参与夺宝。</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;"><br />\n</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;">1元夺宝，就是这么简单！</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;">2、1元夺宝是怎么计算幸运号码的？</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;">1）商品的最后一个号码分配完毕后，将公示该分配时间点前本站全部商品的最后50个参与时间；</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;">2）将这50个时间的数值进行求和（得出数值A）（每个时间按时、分、秒、毫秒的顺序组合，如20:15:25.362则为201525362）；</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;">3）为保证公平公正公开，系统还会等待一小段时间，取最近下一期中国福利彩票“老时时彩”的开奖结果（一个五位数值B）；</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;">4）（数值A+数值B）除以该商品总需人次得到的余数 + 原始数 10000001，得到最终幸运号码，拥有该幸运号码者，直接获得该商品。</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;">注：如遇福彩中心通讯故障，无法获取上述期数的中国福利彩票“老时时彩”开奖结果，且24小时内该期“老时时彩”开奖结果仍未公布，则默认“老时时彩”开奖结果为111111。</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;">了解更多“老时时彩”信息</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;"><br />\n</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;">3、为什么要加入“老时时彩”开奖结果？</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;">引入“老时时彩”开奖结果是为了保证幸运号码计算结果的绝对公平公正。</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;"><br />\n</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;">4、幸运号码的计算结果可信吗？</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;">由于使用了“老时时彩”开奖结果作为参数，因此幸运号码肯定是未知的；</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;">您可以绝对相信计算结果真实、可信。</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;"><br />\n</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;">5、怎样查看是否中奖？</div>\n<div style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;">个人中心有您的夺宝记录，点击对应的记录，即可知道该期夺宝的获得者</div>\n<p style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;"><br />\n</p>\n<p style="margin:0px auto;font-family:&quot;microsoft yahei&quot;, simhei, sans-serif;font-size:14px;line-height:26px;"><span style="font-size:14px;color:#000000;">6、</span><span style="font-size:14px;font-family:&quot;sans serif&quot;, tahoma, verdana, helvetica;line-height:1.5;color:#000000;">支付宝安全问题，参考夺宝保障——支付安全</span></p>\n<p><span style="font-size:14px;color:#000000;">（问题不断整理中,有任何疑问可咨询我们的客服QQ，或来电咨询）</span></p>\n', 1, 1468887871, 1468953713, 0, 1, '', 0, 0, 0, 3, '', '', '', '', 0, '', ''),
(4, '公平保障', '<span style="font-size:18px;">谷创商城夺宝承诺：保证所有参与夺宝的用户行为，都享受同样的权利与义务。</span>', 2, 1468947779, 1468947779, 0, 1, '', 0, 0, 0, 4, '', '', '', '', 0, '', ''),
(5, '公平保障', '<p><span style="font-size:18px;">谷创商城夺宝幸运号码计算公式，加入了“老时时彩”数据作为公正数据源，保证揭晓结果的随机性，保证绝对公正性。</span></p>\n<p><span style="font-size:18px;line-height:27px;">“老时时彩”是第三方公开、公正平台，是不可操作的，保障了开奖的公正，未开奖的那一刻，谁都不知道哪个能中奖。</span></p>\n', 2, 1468947953, 1468947953, 0, 1, '', 0, 0, 0, 5, '', '', '', '', 0, '', ''),
(6, '公开保障', '<span style="font-size:18px;">谷创商城夺宝的夺宝过程是完全透明的，您可以随时查看每个商品的参与人数、参与次数、参与名单及幸运号码信息等记录。</span>', 2, 1468948212, 1468948212, 0, 1, '', 0, 0, 0, 6, '', '', '', '', 0, '', ''),
(7, '支付安全', '<p><span style="font-size:16px;"><b><span style="color:#d40a00;">支付方式：</span></b></span></p>\n<p><span style="font-size:16px;">谷创商城夺宝采用“支付宝”作为支付方式保证了资金的安全。</span></p>\n<p><br />\n</p>\n<p><font color="#d40a00"><span style="font-size:16px;line-height:24px;"><b>支付流程如下：</b></span></font></p>\n<p></p>\n<span style="font-size:16px;line-height:1.5;">1、谷创商城夺宝网站发起支付请求</span><br />\n<span style="font-size:16px;line-height:1.5;">2、跳转到支付宝官方登入界面</span><br />\n<span style="font-size:16px;line-height:1.5;">3、输入账号和<span style="color:#d40a00;">支付密码</span></span><br />\n<span style="font-size:16px;line-height:1.5;">4、支付成功</span><br />\n<span style="font-size:16px;line-height:1.5;">5、支付宝返回支付成功数据给谷创商城夺宝商城</span><br />\n<span style="font-size:16px;line-height:1.5;">6、商城完成支付，生产交易订单</span><br />\n<p></p>\n<p><br />\n</p>\n<p><span style="font-size:16px;">首先得识别两个官网：<span style="color:#d40a00;"><b>521zydb.com &nbsp;是谷创商城夺宝的官方网站</b></span></span></p>\n<p><span style="font-size:16px;color:#d40a00;"><b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; alipay.com &nbsp; &nbsp;是支付宝的官方网站</b></span></p>\n<p><span style="font-size:16px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><span style="color:#f10b00;font-size:16px;">&nbsp; &nbsp; &nbsp;（ XXX.</span><span style="font-size:16px;">alipay.com &nbsp; XXX是alipay.com的二级域名，.com前面的英文字母是一级域， &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;名所有一级域名前面可以加N个“XXX. ”这些二级域名都属于一级旗下的域名。可以看 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;qq.com ,QQ的网站不但很多二级域名，还有很多三级域名。）</span></p>\n<p><span style="font-size:16px;"><br />\n</span></p>\n<p><span style="font-size:16px;"><br />\n</span></p>\n<p><span style="font-size:16px;">支付宝支付流程如下图所示：</span><b style="font-size:16px;line-height:1.5;"><span style="color:#d40a00;">图一、二，为谷创商城夺宝界面：</span></b></p>\n<p><br />\n</p>\n<p><img src="./public/attachment/201607/20/09/578ed42611fe2.png" width="900" alt="" border="0" /><br />\n</p>\n<p><br />\n</p>\n<p><br />\n</p>\n<p><img src="./public/attachment/201607/20/09/578ed43de9146.png" width="900" alt="" border="0" /></p>\n<p><b><br />\n</b></p>\n<p><span style="font-size:16px;"><b><span style="color:#d40a00;">图三、四为支付宝界面，付款时，全程是在支付宝平台交易的，支付宝作为国内最大的第三方支付平台之一，具有很高的安全性！</span></b></span></p>\n<p><br />\n</p>\n<p><img src="./public/attachment/201607/20/09/578ed4465dfa5.png" width="900" alt="" border="0" /><img src="./public/attachment/201607/20/09/578ed4508eeee.png" width="900" alt="" border="0" /><br />\n</p>\n', 2, 1468950264, 1468950482, 0, 1, '', 0, 0, 0, 7, '', '', '', '', 0, '', ''),
(8, '商品配送', '<p><span style="font-size:16px;">在您成为幸运用户后，</span><span style="line-height:1.5;"><span style="font-size:16px;">请您尽快提交收货地址，</span></span><span style="line-height:1.5;"><span style="font-size:16px;">谷创商城夺宝会第一时间为您寄出商品，大陆地区免快递费。</span></span><span style="line-height:1.5;"><span style="font-size:16px;">超过7天未确认收货地址，视为自动放弃该商品。</span></span></p>\n<p><span style="line-height:1.5;"><span style="font-size:16px;">如不在配送范围，或者物件不方便配送，可与客服协商处理！</span></span></p>\n', 3, 1468952138, 1468952138, 0, 1, '', 0, 0, 0, 8, '', '', '', '', 0, '', ''),
(9, '投诉建议', '<p style="margin-top:0px;margin-bottom:0px;padding:0px;color:#808080;font-family:;" microsoft="" yahei",="" verdana;font-size:14px;line-height:26px;"="">谷创商城夺宝致力于为用户提供更好的服务。如果在使用过程中遇到问题，或是有任何想法和建议，请让我们知道，以便我们为大家提供更优质的产品和服务。</p>\n<p style="margin-top:0px;margin-bottom:0px;padding:0px;color:#808080;font-family:;" microsoft="" yahei",="" verdana;font-size:14px;line-height:26px;"="">可随时联系我们客服反映情况。</p>\n', 3, 1468954109, 1468957696, 0, 1, '', 0, 0, 0, 9, '', '', '', '', 0, '', ''),
(10, '商品验收与签收', '<div><span style="font-size:16px;">1、签收时请慎重，尽量本人签收，签收时务必仔细检查商品，如：外包装是否被开封，商品是否破损，配件是否缺失，功能是否正常。在确保无误后再签收，以免产生不必要的纠纷。若有任何疑问，请及时拨打客服电话反馈信息，若因用户未仔细检查商品即签收后产生的纠纷，谷创商城夺宝概不负责，仅承担协调处理的义务；</span></div>\n<div><span style="font-size:16px;">2、用户所获商品，相关商品质量及保修问题请直接联系生产厂家；</span></div>\n<div><span style="font-size:16px;">3、若因您的地址填写错误、联系方式填写有误等情况造成商品无法完成投递或被退回，所产生的额外费用及后果由用户负责；</span></div>\n<div><span style="font-size:16px;">4、如因不可抗拒的自然原因，如地震、洪水等，所造成的商品配送延迟，谷创商城夺宝不承担责任；</span></div>\n<div><span style="font-size:16px;">5、温馨提醒：若商品已签收，则说明商品配送正确无误且不存在影响使用的因素，谷创商城夺宝有权不受理换货申请。</span></div>\n', 3, 1468954258, 1468954258, 0, 1, '', 0, 0, 0, 10, '', '', '', '', 0, '', ''),
(11, '长期未收到货物', '<p><span style="font-size:16px;">1、确保收货地址、邮编、电话、Email、地址等各项信息的准确性；</span></p>\n<p><span style="font-size:16px;line-height:1.5;">2、配送过程中联系方式畅顺无阻，如果联络您的时间超过7天未得到回复，默认您已经放弃此商品。</span></p>\n<p><span style="font-size:16px;line-height:1.5;">3、配送过程保持电话畅通，有任何问题可联系客服解决。</span></p>\n', 3, 1468954349, 1468954349, 0, 1, '', 0, 0, 0, 11, '', '', '', '', 0, '', ''),
(12, '加盟合作', '<span style="font-size:16px;">谷创商城夺宝是福建睿辰网络科技有限公司旗下的一个夺宝众筹商城，现面向三明各地区招合作商或者加盟商，公司提供技术支持，和运营培训！</span>', 1, 1468955023, 1468957722, 0, 1, '', 0, 0, 0, 12, '', '', '', '', 0, '', ''),
(13, '商家入驻', '<span style="font-size:16px;">谷创商城夺宝运营公司，严格把控商品质量，所有入驻商品必须满足有三证，进货/生产类相关证明和资质，欢迎各界满足条件的商家入驻。</span>', 1, 1468955161, 1468957711, 0, 1, '', 0, 0, 0, 13, '', '', '', '', 0, '', '');
